import React from 'react'
import { useSelector } from 'react-redux'

export default function UserProfileImage({user}) {
    return (
        <div className="user-profile-image">
            {(user.imgUrl) ? <img src={user.imgUrl} /> : <h1>{user.username.charAt(0)}</h1>}
        </div>
    )
}
